import React from 'react';
import './App.css';
import axios from 'axios';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      userId: 'wsu718'
    }
  };

  componentDidMount(){
    axios.get(`https://api.github.com/users/${this.state.userId}`)
    .then(response => {
      console.log(response)
    })
    .catch(error => {
      console.log('Error:', error.message);
    })
  }

  render() {
    return (
      <div className="App">
        Test
      </div>
    )  
  }
};

export default App;
